const our_chats = [
    {
        name:'name',
        image_path:'favicon.png',
    },

]

export function Chat(){
    return(
        our_chats.map(item=>{
            return(
                <div class="chat">
                    <img src={our_chats.image_path} alt=""/>
                    <span class="chat_name">{our_chats.name}</span>
                </div>
            );
        })
    );
}
